@jax.default_matmul_precision('float32')
def test_einsum_kpmurphy_example(self):
    N, C, D, K, T = (2, 3, 4, 5, 6)
    r = self.rng()
    S = r.randn(N, T, K)
    W = r.randn(K, D)
    V = r.randn(D, C)
    L = np.zeros((N, C))
    for n in range(N):
        for c in range(C):
            s = 0
            for d in range(D):
                for k in range(K):
                    for t in range(T):
                        s += S[n, t, k] * W[k, d] * V[d, c]
            L[n, c] = s
    path = jnp.einsum_path('ntk,kd,dc->nc', S, W, V, optimize='optimal')[0]
    self.assertAllClose(L, jnp.einsum('ntk,kd,dc->nc', S, W, V, optimize=path), check_dtypes=False)

